import { Component,  OnInit } from '@angular/core';
import { AngularRecrutadoresService } from 'src/app/shared/angular-recrutadores.service';

@Component({
  selector: 'app-angular-recrutadores-form',
  templateUrl: './angular-recrutadores-form.component.html',
  styleUrls: ['./angular-recrutadores-form.component.css']
})
export class AngularRecrutadoresFormComponent {
  constructor(public service:AngularRecrutadoresService){}
  ngOnInit(): void {}
}
<form>
  <input type="hidden" name="id" [value]="" />
  <div class="form-row">
<div class="col-md-6 form-group customizado">
  <label>Nome</label>
  <input type="text" class="form-control form-control-lg" placeholder="Full Name" name="nome" #nome="ngModel" [(ngModel)]="service.formData.nome" />
</div>

<div class="col-md-6 form-group customizado">
  <label>Email</label>
  <input type="text" class="form-control form-control-lg" placeholder="Full Name" name="email" #email="ngModel" [(ngModel)]="service.formData.nome" />
</div>
<div class="col-md-6 form-group customizado">
  <label>Empresa</label>
  <input type="text" class="form-control form-control-lg" placeholder="Full Name" name="empresa" #emoresa="ngModel" [(ngModel)]="service.formData.nome" />
</div>
</div>
</form>
